import { Link } from "react-router-dom";
import './index.css'
export default class Index extends React.Component {
  render() {
    return (
      <div className='indexbox'>
          <div style={{background:"rgb(0,145,255)"}}>
           <div className='headbox'>
<div className='address'>四川大学</div>
            </div>
        <div className='search'><div className='search-content'></div>
</div>  
          </div>
            
      </div>
    );
  }
}
